We are asked to find the value of $(a)$ x $(b)$ when $a = 3$ and $b = 5$. 
Recall that $(a)$ x $(b) = a^2 + 2ab + b^2$.
Substitute $a = 3$ and $b = 5$ into the formula.
\begin{align*}
(a) x (b) &= a^2 + 2ab + b^2 \\
&= (3)^2 + 2(3)(5) + (5)^2 \\
&= 9 + 30 + 25 \\
&= \boxed{64}
\end{align*}
Therefore, the value of $(a)$ x $(b)$ when $a = 3$ and $b = 5$ is 64. $\blacksquare$
